#####################################################################
#   UUID Setting
#####################################################################
[mcu]
canbus_uuid: 0b024ab48261

[mcu EBBCan]
#canbus_uuid: 2f0b1ce14660
canbus_uuid: 616ed9869801

[printer]
kinematics: corexy
max_velocity: 300  
max_accel: 8000    			
max_z_velocity: 25 			
max_z_accel: 350
square_corner_velocity: 5.0

#####################################################################
# Cartographer Setting
#####################################################################

[cartographer]
canbus_uuid: aececbb4035e
speed: 40.                         #   Z probing dive speed.
lift_speed: 5.                     #   Z probing lift speed.
backlash_comp: 0.5                 #   Backlash compensation distance for removing Z backlash before measuring the sensor response.
x_offset: 0.                       #   X offset of cartographer from the nozzle.
y_offset: 21.1                     #   Y offset of cartographer from the nozzle.
trigger_distance: 2.               #   cartographer trigger distance for homing.
trigger_dive_threshold: 1.5        #   Threshold for range vs dive mode probing. Beyond `trigger_distance + trigger_dive_threshold` a dive will be used.
trigger_hysteresis: 0.006          #   Hysteresis on trigger threshold for untriggering, as a percentage of the trigger threshold.
cal_nozzle_z: 0.1                  #   Expected nozzle offset after completing manual Z offset calibration.
cal_floor: 0.1                     #   Minimum z bound on sensor response measurement.
cal_ceil: 5.                       #   Maximum z bound on sensor response measurement.
cal_speed: 1.0                     #   Speed while measuring response curve.
cal_move_speed: 10.                #   Speed while moving to position for response curve measurement.
default_model_name: default        #   Name of default cartographer model to load.
mesh_main_direction: x             #   Primary travel direction during mesh measurement.
#mesh_overscan: -1                 #   Distance to use for direction changes at mesh line ends. 
                                   #   Omit this setting and a default will be calculated from line spacing and available travel.
mesh_cluster_size: 1               #   Radius of mesh grid point clusters.
mesh_runs: 2                       #   Number of passes to make during mesh scan.


#####################################################################
# 	X/Y Stepper Settings
#####################################################################

## X Stepper on Motor1(B Motor)
[stepper_x]
step_pin: PE2
dir_pin: !PB4
enable_pin: !PC11
microsteps: 64
rotation_distance: 40
# endstop_pin: ^EBBCan: PB6    1
endstop_pin:tmc2209_stepper_x:virtual_endstop
position_min: 0
position_endstop: 350
position_max: 350

##--------------------------------------------------------------------
homing_speed: 20 #Max 100
homing_retract_dist: 0
homing_positive_dir: true

[tmc2209 stepper_x]
uart_pin: PC10
interpolate: False
run_current: 1.2
sense_resistor: 0.110
stealthchop_threshold: 0
# driver_SGTHRS: 100   # original value 1
driver_SGTHRS: 60
diag_pin: ^PF3



## Y Stepper on Motor2 (A Motor)
[stepper_y]
step_pin: PF12  
dir_pin: !PF11 
enable_pin: !PB3
microsteps: 64

rotation_distance: 40
# endstop_pin: PA2
endstop_pin:tmc2209_stepper_y:virtual_endstop
position_min: 0
position_endstop: 350
position_max: 350

##--------------------------------------------------------------------
homing_speed: 20  #Max 100
homing_retract_dist: 0
homing_positive_dir: true

[tmc2209 stepper_y]
uart_pin: PF13
interpolate: False
run_current: 1.2
sense_resistor: 0.110
stealthchop_threshold: 0
# driver_SGTHRS: 100
driver_SGTHRS: 60
diag_pin: ^PF4 


#####################################################################
# 	Z Stepper Settings
#####################################################################

## Z0 Stepper - Front Left on MOTOR3
[stepper_z]
step_pin: PD7
dir_pin: !PD6
enable_pin: !PF10
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16
#endstop_pin: ^PF5
endstop_pin: probe:z_virtual_endstop
position_max: 340

##--------------------------------------------------------------------
position_min: -5
homing_speed: 8
second_homing_speed: 3
# homing_retract_dist: 3
homing_retract_dist: 0

[tmc2209 stepper_z]
uart_pin: PF9
interpolate: True
run_current: 1.0
sense_resistor: 0.110
stealthchop_threshold: 0



##	Z1 Stepper - Rear Left on Motor4
[stepper_z1]
step_pin: PD3
dir_pin: PD2
enable_pin: !PD5
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16

[tmc2209 stepper_z1]
uart_pin: PD4
interpolate: True
run_current: 1.0
sense_resistor: 0.110
stealthchop_threshold: 0


##	Z2 Stepper - Rear Right on Motor5
[stepper_z2]
step_pin: PC9
dir_pin: !PC8
enable_pin: !PD1
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16

[tmc2209 stepper_z2]
uart_pin: PD0
interpolate: True
run_current: 1.0
sense_resistor: 0.110
stealthchop_threshold: 0


##	Z3 Stepper - Front Right on Motor6
[stepper_z3]
step_pin: PA10
dir_pin: PA14
enable_pin: !PA15
rotation_distance: 40
gear_ratio: 80:16
microsteps: 16

[tmc2209 stepper_z3]
uart_pin: PF8
interpolate: True
run_current: 1.0
sense_resistor: 0.110
stealthchop_threshold: 0

