#tachometer_ppr: 2
control: pid #watermark
pid_kp = 69.130
pid_ki = 0.907
pid_kd = 1316.919
#max_delta:3
sensor_type: temperature_host
min_temp:0
max_temp:100
target_temp:34
gcode_id:CB1_Fan
max_speed: 1.0
