# cycle_time: 0.100


[quad_gantry_level]
gantry_corners:
	-60,-10
	410,420
points:
	50,25
	50,275
	300,275
	300,25

#--------------------------------------------------------------------
speed: 200
horizontal_move_z: 10
retries: 20
#retry_tolerance: 10.0075
retry_tolerance: 0.0050  # added after multiple quad fails
max_adjust: 10

[bed_mesh]
speed: 200
horizontal_move_z: 5
mesh_min: 10,25
mesh_max: 330,335
mesh_pps:2,2
probe_count: 64,64
algorithm: bicubic
bicubic_tension: 0.2
fade_start: 1
fade_end: 10
fade_target: 0

